import React from "react";

export default class ListWidgetComponent extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            elements: false,
        }
    }

    componentDidMount() {
        const {requestUrl} = this.props;
        const url = 'http://localhost:5000' + requestUrl;
        console.log(url);
        this.setState({
            elements: true
        })
        fetch(url)
            .then(res => res.json())
            .then(result => console.log(result));
    }

    render() {
        return (
            <span>
                {this.props.msg}
            </span>
        );
    }
};
